'use strict';

const remote = nodeRequire('remote');
const RtmClient = remote.require('@slack/client').RtmClient;
const RTM_EVENTS = remote.require('@slack/client').RTM_EVENTS;
const IMG_WIDTH = 208;
const IMG_HEIGHT = 60;
const IMG_COVER_RATIO = 0.8;
const ALERT_BASE64 = "";// const ALERT_BASE64 = "";

var slackToken = process.env.SLACK_API_TOKEN || '';
var alertKeyword = process.env.ALERT_KEYWORD || 'critical';
var resolvedKeyword = process.env.RESOLVED_KEYWORD || 'ok';

var slack = {
  startListening : function(token, screen) {
    var rtm = new RtmClient(token, {logLevel: 'info'});
    rtm.start();
    console.log("listening to " + token);
    rtm.on(RTM_EVENTS.MESSAGE, function (message) {
        var alertRegexp = new RegExp(alertKeyword, 'i');
        var resolvedRegexp = new RegExp(resolvedKeyword, 'i');
        if(message.text.match(alertRegexp)) {
            console.log("critical:" + message.text);
            screen.playSound();
            screen.draw();
        } else if (message.text.match(resolvedRegexp)) {
            console.log("clean:" + message.text);
            screen.stopSound();
            screen.clear();
        }
    });   
  }
};

var screen = {
  alertSound : new Audio("data:audio/wav;base64," + ALERT_BASE64),
  playSound : function() {
      this.alertSound.currentTime = 0;
      this.alertSound.play();
  },
  stopSound : function() {
      this.alertSound.pause();
  },
  draw : function() {
      var shuffle = function() {return Math.random()-.5};
      var imagePositions = function(width, height) {
        var array = [];
        for(var i=0; i<height; i++) {
            for(var j=0; j<width; j++) {
              array.push({x: j*IMG_WIDTH+(i%2)*IMG_WIDTH/2, y: i*IMG_HEIGHT});
            }
        }
        return array;
      };
      var sleep = function(ms) {
        return function(func) {
          setTimeout(function() {
            func();
          }, ms);
        }
      };
      var context = $("#canvas")[0].getContext('2d');
      var image = new Image();
      image.src = 'img/emergency.png';
      image.addEventListener('load', function() {
          var images = imagePositions(context.canvas.width/IMG_WIDTH, context.canvas.height/IMG_HEIGHT-2).sort(shuffle);
          $.each(images.slice(0, images.length*IMG_COVER_RATIO), 
              function(idx, pos){
                  sleep(10*idx)(function(){
                      context.drawImage(image, pos.x, pos.y);
                  });
              });
      }, false);
  },
  clear : function() {
      var context = $("#canvas")[0].getContext('2d');
      context.clearRect(0, 0, context.canvas.width, context.canvas.height);
  },
  setup : function() {
      $("#canvas").attr({height:$("#screen").height()});
      $("#canvas").attr({width:$("#screen").width()});
  }
};


$(document).ready(function() {
    if(!slackToken) {
      console.error("SLACK_API_TOKEN is required.");
      window.close();
    }
    screen.setup();
    slack.startListening(slackToken, screen);
});
